ast year I spent it on that. Here it is.\\nI hope you like it. I tried to do it in a bit different way. Curious for the feedback. I know I will be hardly able to beat the choice of music from the first part, but let me say, Vangelis Alpha is a piece that is very dear to my heart, I always had this in mind.\\nStill looking for contact to musicians.\\nI do not know what the future brings, but I hope we will hear from each other. Enjoy.\\n\\nmorn1415 Social Media:\\n\\nhttps:\/\/www.patreon.com\/morn1415\\nhttps:\/\/twitter.com\/morn1415\\nhttps:\/\/www.facebook.com\/morn1415\/\\nhttps:\/\/www.instagram.com\/morn1415\/\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/GoW8Tf7hTGA\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLABdi0IVW16Zt80e3omhU41DZyDrQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/GoW8Tf7hTGA\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLB5_HWHn-3jh5Xx2Ci694Gp6_DdmA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/GoW8Tf7hTGA\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBGARFrrrB3mRkyuvewfEJLxpvNEQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/GoW8Tf7hTGA\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCZiC7TeYkLFcKpptsTA13mc7uzHA\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/GoW8Tf7hTGA\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.879796,\"allowRatings\":true,\"viewCount\":\"27469702\",\"author\":\"morn1415\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"playerConfig\":{\"audioConfig\":{\"loudnessDb\":-0.99358845,\"perceptualLoudnessDb\":-14.993588,\"enablePerFormatLoudness\":false},\"streamSelectionConfig\":{\"maxBitrate\":\"7020000\"},\"mediaCommonConfig\":{\"dynamicReadaheadConfig\" xt":{"runs":[{"text":"181K subscribers"}]},"trackingParams":"CJMBEOE5IhMItIqRsbea6QIVVazVCh382AUI"}},"description":{"runs":[{"text":"Dear world,\nLet´s talk about time.\nWhen I uploaded my first YouTube video 7 years ago, I would have never thought that it would get that much attention. Had lots of discussions, met new people, continued to make videos about things that intrigued me. Or tried out effects.\n\nI enjoyed it a lot, and I still read every comment that pops up. And they keep coming in. It is a hobby that I am very glad about having started. And I am humbled by the attention.\n \nWell, as time went by I found less time to work on videos, struggled with other things in life, and wondered if I would ever find the time again.\n\nBut I always knew one thing:\nI owe you something. All the time people were are asking about a sequel to starsize comparison. And yes, I promised once.\nI keep my promises. So, whenever I found time over the last year I spent it on that. Here it is.\nI hope you like it. I tried to do it in a bit different way. Curious for the feedback. I know I will be hardly able to beat the choice of music from the first part, but let me say, Vangelis Alpha is a piece that is very dear to my heart, I always had this in mind.\nStill looking for contact to musicians.\nI do not know what the future brings, but I hope we will hear from each other. Enjoy.\n\nmorn1415 Social Media:\n\n"},{"text":"https://www.patreon.com/morn1415","navigationEndpoint":{"clickTrackingParams":"CI8BEM2rARgBIhMItIqRsbea6QIVVazVCh382AUISOCYhfffie_CGg==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.patreon.com%2Fmorn1415\u0026event=video_description\u0026v=GoW8Tf7hTGA\u0026redir_token=ILE2gbX44Sbf0t5wVRLkXp2JuyN8MTU4ODY4OTQxMEAxNTg4NjAzMDEw","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.patreon.com%2Fmorn1415\u0026event=video_description\u0026v=GoW8Tf7hTGA\u0026redir_token=ILE2gbX44Sbf0t5wVRLkXp2JuyN8MTU4ODY4OTQxMEAxNTg4NjAz
